// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";
import "../interfaces/IProperty.sol";
import "../interfaces/IShares.sol";

contract Escrow is Ownable, Pausable {
    using Math for uint256;

    enum EscrowState { Pending, Completed, Disputed, Refunded }

    struct Transaction {
        address buyer;
        address seller;
        uint256 basketId;
        uint256 amount;
        EscrowState state;
        uint256 createdAt;
        uint256 updatedAt;
        string disputeReason;
    }

    uint256 public transactionCount;
    mapping(uint256 => Transaction) public transactions;

    IProperty public propertyContract;
    IShares public sharesContract;

    event TransactionCreated(uint256 transactionId, address indexed buyer, address indexed seller, uint256 basketId, uint256 amount);
    event TransactionCompleted(uint256 transactionId);
    event TransactionRefunded(uint256 transactionId);
    event TransactionDisputed(uint256 transactionId, string reason);

    modifier onlyBuyer(uint256 transactionId) {
        require(msg.sender == transactions[transactionId].buyer, "Not authorized");
        _;
    }

    modifier onlySeller(uint256 transactionId) {
        require(msg.sender == transactions[transactionId].seller, "Not authorized");
        _;
    }

    modifier onlyPending(uint256 transactionId) {
        require(transactions[transactionId].state == EscrowState.Pending, "Transaction is not pending");
        _;
    }

    constructor(address _propertyContract, address _sharesContract) Ownable(msg.sender) {
    propertyContract = IProperty(_propertyContract);
    sharesContract = IShares(_sharesContract);
    _pause(); // Initialize the contract in a paused state
}

    function createTransaction(address seller, uint256 basketId) external payable whenNotPaused {
    require(msg.value > 0, "Amount must be greater than 0");
    IShares.ShareBasket memory basket = sharesContract.getBasketDetails(basketId);
    require(basket.totalShares > 0, "Invalid basket");

    transactionCount++;
    transactions[transactionCount] = Transaction({
        buyer: msg.sender,
        seller: seller,
        basketId: basketId,
        amount: msg.value,
        state: EscrowState.Pending,
        createdAt: block.timestamp,
        updatedAt: block.timestamp,
        disputeReason: ""
    });

    emit TransactionCreated(transactionCount, msg.sender, seller, basketId, msg.value);
}

    function completeTransaction(uint256 transactionId) external onlySeller(transactionId) onlyPending(transactionId) {
        Transaction storage txn = transactions[transactionId];
        txn.state = EscrowState.Completed;
        payable(txn.seller).transfer(txn.amount);

        // Issue shares to the buyer
        sharesContract.issueShares(txn.basketId, txn.buyer, txn.amount);

        txn.updatedAt = block.timestamp;

        emit TransactionCompleted(transactionId);
    }

    function refundTransaction(uint256 transactionId) external onlyBuyer(transactionId) onlyPending(transactionId) payable {
        Transaction storage txn = transactions[transactionId];
        txn.state = EscrowState.Disputed;
        payable(txn.buyer).transfer(txn.amount);
        txn.updatedAt = block.timestamp;

        emit TransactionRefunded(transactionId);
    }

    function disputeTransaction(uint256 transactionId, string calldata reason) external onlyBuyer(transactionId) onlyPending(transactionId) {
        Transaction storage txn = transactions[transactionId];
        txn.state = EscrowState.Disputed;
        txn.disputeReason = reason;
        txn.updatedAt = block.timestamp;

        emit TransactionDisputed(transactionId, reason);
    }

    function resolveDispute(uint256 transactionId, bool approve) external onlyOwner payable {
        Transaction storage txn = transactions[transactionId];
        require(txn.state == EscrowState.Disputed, "Transaction is not disputed");

        if (approve) {
            txn.state = EscrowState.Completed;
            payable(txn.seller).transfer(txn.amount);
            sharesContract.issueShares(txn.basketId, txn.buyer, txn.amount);
            emit TransactionCompleted(transactionId);
        } else {
            txn.state = EscrowState.Refunded;
            payable(txn.buyer).transfer(txn.amount);
            emit TransactionRefunded(transactionId);
        }
        txn.updatedAt = block.timestamp;
    }

    function getTransaction(uint256 transactionId) external view returns (
        address buyer,
        address seller,
        uint256 basketId,
        uint256 amount,
        EscrowState state,
        uint256 createdAt,
        uint256 updatedAt,
        string memory disputeReason
    ) {
        Transaction storage txn = transactions[transactionId];
        return (
            txn.buyer,
            txn.seller,
            txn.basketId,
            txn.amount,
            txn.state,
            txn.createdAt,
            txn.updatedAt,
            txn.disputeReason
        );
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

contracts/interfaces/IShares.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IShares {
    // Enum to represent the state of shares issuance
    enum ShareStatus { Issued, Transferred, Redeemed, Cancelled }


    struct ShareBasket {
        uint256 basketId;
        uint256[] propertyIds;
        uint256 totalShares;
    }

    function getBasketDetails(uint256 basketId) external view returns (ShareBasket memory);
    function issueShares(uint256 basketId, address to, uint256 amount) external;
    // Structure to define a shareholding

    struct Shareholding {
        uint256 shareId;
        address holder;
        uint256 propertyId;
        uint256 amount;
        ShareStatus status;
        uint256 issuedAt;
        uint256 lastUpdated;
    }

    // Events
    event SharesIssued(uint256 indexed shareId, address indexed holder, uint256 indexed propertyId, uint256 amount);
    event SharesTransferred(uint256 indexed shareId, address indexed from, address indexed to, uint256 amount);
    event SharesRedeemed(uint256 indexed shareId, address indexed holder, uint256 amount);
    event SharesCancelled(uint256 indexed shareId, address indexed holder, uint256 amount);

    // Function to issue shares for a property
    function issueShares(address holder, uint256 propertyId, uint256 amount) external returns (uint256);

    // Function to transfer shares from one holder to another
    function transferShares(uint256 shareId, address to, uint256 amount) external;

    // Function to redeem shares for a property
    function redeemShares(uint256 shareId, uint256 amount) external;

    // Function to cancel issued shares
    function cancelShares(uint256 shareId, uint256 amount) external;

    // Function to get details of a specific shareholding
    function getShareholding(uint256 shareId) external view returns (Shareholding memory);

    // Function to get the total number of shares issued for a specific property
    function getTotalShares(uint256 propertyId) external view returns (uint256);

    // Function to get the number of shares held by a specific holder
    function getHolderShares(address holder) external view returns (Shareholding[] memory);
}

contracts/interfaces/IProperty.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IProperty {
    // Enum to represent the state of the property
    enum PropertyStatus { Active, Inactive, Sold, Removed }

    // Structure to define the details of a property
    struct PropertyDetails {
        uint256 id;
        address owner;
        string location;
        string description;
        uint256 price;
        PropertyStatus status;
        uint256 createdAt;
        uint256 updatedAt;
    }

    // Events
    event PropertyCreated(uint256 indexed propertyId, address indexed owner, string location, string description, uint256 price);
    event PropertyUpdated(uint256 indexed propertyId, uint256 newPrice, PropertyStatus newStatus);
    event PropertyOwnershipTransferred(uint256 indexed propertyId, address indexed newOwner, uint256 price);
    event PropertyStatusChanged(uint256 indexed propertyId, PropertyStatus newStatus);
    event PropertyRemoved(uint256 indexed propertyId, address indexed owner);

    // Function to get property details
    function getPropertyDetails(uint256 propertyId) external view returns (PropertyDetails memory);

    // Function to update property details
    function updateProperty(uint256 propertyId, string calldata location, string calldata description, uint256 price) external;

    // Function to transfer ownership of the property
    function transferOwnership(uint256 propertyId, address newOwner) external payable;

    // Function to change the status of the property
    function changePropertyStatus(uint256 propertyId, PropertyStatus newStatus) external;

    // Function to remove the property from the system
    function removeProperty(uint256 propertyId) external;

    // Function to get the total number of properties managed by the contract
    function getTotalProperties() external view returns (uint256);
}

